r($,"c_f","amG",()=>{var q="assets/imgs/black_hole.png",p="A black hole is a region in space where gravity is so strong that nothing, not even light, can escape from it. This extreme gravitational pull occurs when a massive star collapses under its own gravity at the end of its life cycle. Black holes can vary in size, from stellar black holes formed from dying stars to supermassive black holes found at the centers of galaxies.",o="https://s3.amazonaws.com/scifri-segments/scifri202409201.mp3",n="assets/imgs/superearth.png",m="assets/images/kepler452b.webp",l="assets/images/terrestrial.webp",k="assets/images/gasgiant.webp"
return A.b([A.a4r(q,p,p,q,"1",q,"Black Hole","https://s3.amazonaws.com/scifri-segments/scifri202404263.mp3"),A.a4r(n,"Proxima Centauri b (or Proxima b),[5] also referred to as Alpha Centauri Cb ","Proxima Centauri b (or Proxima b),[5] also referred to as Alpha Centauri Cb, is an exoplanet orbiting within the habitable zone of the red dwarf star Proxima Centauri, which is the closest star to the Sun and part of the larger triple star system Alpha Centauri. It is about 4.2 light-years (1.3 parsecs) from Earth in the constellation Centaurus, making it and Proxima d, along with the currently disputed Proxima c, the closest known exoplanets to the Solar System. Proxima Centauri b orbits its parent star at a distance of about 0.04856 AU (7.264 million km; 4.514 million mi) with an orbital period of approximately 11.2 Earth days. Its other properties are only poorly understood as of 2024, but it is believed to be a potentially Earth-like planet with a minimum mass of at least 1.07 M\ud83d\udf28 and only a slightly larger radius than that of Earth. The planet orbits within the habitable zone of its parent star; but it is not known whether it has an atmosphere, which would impact the habitability probabilities. Proxima Centauri is a flare star with intense emission of electromagnetic radiation that could strip an atmosphere off the planet. The exoplanet's proximity to Earth offers an opportunity for robotic space exploration.Announced on 24 August 2016 by the European Southern Observatory (ESO), Proxima Centauri b was confirmed via several years of using the method of studying the radial velocity of its parent star. Furthermore, the discovery of Proxima Centauri b, a planet at habitable distances from the closest star to the Solar System, was a major discovery in planetology,[6] and has drawn interest to the Alpha Centauri star system as a whole, of which Proxima itself is a member.[7] As of 2023, Proxima Centauri b is believed to be the best-known exoplanet to the general public.[8]",n,"2",n,"Proxima Centauri b (or Proxima b)",o),A.a4r(m,"Kepler-452b (sometimes quoted to be an Earth 2.0 or Earth Cousin based on its characteristics also known by its Kepler object of interest designation KOI-7016.01","Kepler-452b (sometimes quoted to be an Earth 2.0 or Earth's Cousin based on its characteristics; also known by its Kepler object of interest designation KOI-7016.01) is a super-Earth exoplanet orbiting within the inner edge of the habitable zone of the sun-like star Kepler-452 and is the only planet in the system discovered by the Kepler space telescope. It is located about 1,400 light-years (430 pc)from Earth in the constellation of Cygnus.Kepler-452b orbits its star at a distance of 1.04 AU (156 million km; 97 million mi) from its host star (nearly the same distance as Earth from the Sun), with an orbital period of roughly 385 days, has a mass at least five times that of Earth, and has a radius of around 1.5 times that of Earth. It is the first potentially rocky super-Earth planet discovered orbiting within the habitable zone of a very Sun-like star.However, it is unknown if it is entirely habitable, as it is receiving slightly more energy from its star than Earth and could be subjected to a runaway greenhouse effect.The Kepler space telescope identified the exoplanet, and its discovery was announced by NASA on 23 July 2015. The planet is about 1,800 light-years (550 pc) away from the Solar System. At the speed of the New Horizons spacecraft, at about 59,000 km/h (16,000 m/s; 37,000 mph), it would take approximately 30 million years to get there.",m,"3",m,"Kepler-452b",o),A.a4r(l,"TRAPPIST-1h, also designated as 2MASS J23062928-0502285 h","RAPPIST-1h, also designated as 2MASS J23062928-0502285 h, is an exoplanet orbiting around the ultra-cool dwarf star TRAPPIST-1, located 40.7 light-years (12.5 parsecs) away from Earth in the constellation Aquarius. It was one of four new exoplanets to be discovered orbiting the star in 2017 using observations from the Spitzer Space Telescope. In the following years, more studies were able to refine its physical parameters.The outermost known planet in its system, it is roughly one third the mass of Earth, and about 76% as large. Its relatively low density indicates that it is likely water-rich, like several other planets in the system.Mass, radius, and temperatureTRAPPIST-1h has a radius of 0.755 R\ud83d\udf28, a mass of 0.326 M\ud83d\udf28, and about 57% Earth's surface gravity.[2] It was initially estimated to have a density of 3.97 g/cm3, similar to that of Mars. Given this density, about \u22645% of its mass may be water, likely in the form of a thick ice shell,[8][9] since it only receives about 13% of the stellar flux that Earth does. It has an equilibrium temperature of 169 K (\u2212104 \xb0C; \u2212155 \xb0F), similar to that of Earth's south pole.Host starTRAPPIST-1h orbits the ultracool dwarf star TRAPPIST-1. It is 0.121 R\u2609 and 0.089 M\u2609, with a temperature of 2511 K and an age between 3 and 8 billion years. For comparison, the Sun has a temperature of 5778 K and is about 4.5 billion years old. TRAPPIST-1 is also very dim, with about 0.0005 times the luminosity of the Sun. The star's apparent magnitude, or how bright it appears from Earth's perspective, is 18.8. Therefore, it is too dim to be seen with the naked eye.OrbitDespite it being the most distant known planet in its system, TRAPPIST-1h orbits its host star with an orbital period of 18.868 days and an orbital radius of about 0.0619 AU. This is even smaller than Mercury's orbit around the Sun (which is about 0.38 AU).Stable liquid water Although TRAPPIST-1h's orbit falls near its star's frost line, it could harbor liquid water under an H2-rich atmosphere, either primordial or resulting from continuous outgassing combined with internal heating, although existence of such atmosphere was strongly disfavored by observations in 2021 and 2022. If ice-covered, it could also potentially harbor a subsurface ocean by way of tidal heating, which could lead to cryovolcanism in the form of erupting geysers.",l,"4",m,"TRAPPIST-1h",o),A.a4r(k,"HD 209458 b is an exoplanet that orbits the solar analog HD 209458 in the constellation Pegasus","HD 209458 b is an exoplanet that orbits the solar analog HD 209458 in the constellation Pegasus, some 157 light-years (48 parsecs) from the Solar System. The radius of the planet's orbit is 0.047 AU (7.0 million km; 4.4 million mi), or one-eighth the radius of Mercury's orbit (0.39 AU (36 million mi; 58 million km)). This small radius results in a year that is 3.5 Earth-days long and an estimated surface temperature of about 1,000 \xb0C (1,800 \xb0F; 1,300 K). Its mass is 220 times that of Earth (0.69 Jupiter masses) and its volume is some 2.5 times greater than that of Jupiter. The high mass and volume of HD 209458 b indicate that it is a gas giant.HD 209458 b represents a number of milestones in exoplanetary research. It was the first of many categories:a transiting extrasolar planet The first planet detected through more than one methodan extrasolar planet known to have an atmospherean extrasolar planet observed to have an evaporating hydrogen atmosphere an extrasolar planet found to have an atmosphere containing the elements oxygen and carbonone of the first two extrasolar planets to be directly observed spectroscopicallyThe first extrasolar gas giant to have its superstorm measuredthe first planet to have its orbital speed measured, determining its mass directly.Based on the application of newer theoretical models, as of April 2007, it is thought to be the first extrasolar planet found to have water vapor in its atmosphere.In July 2014, NASA announced finding very dry atmospheres on HD 209458 b and two other exoplanets (HD 189733 b and WASP-12b) orbiting Sun-like stars.HD 209458 b has been nicknamed Osiris after the Egyptian god. This nickname has been acknowledged by the IAU, but as of 2023 it has not yet been approved as an official proper name.",k,"5",m,"HD 209458 b",o)],A.ad("u<DL>"))})
